import React, { Component } from 'react';
import './App.css';
import Menu from './components/Menubar/Menu'
import {NavbarToggler} from 'reactstrap'

class App extends Component {
  render(){
    return (
      <div>
          <div>
            <Menu />
          </div>
          <div className="test">
            <NavbarToggler onClick={toggleNavbar} className="mr-2"/>
          </div>

      </div>

    );
  }

}
export default App;
